package com.MITProjectService.bot.enums;public enum ServiceTypeEnums {    ACTIVE(1),    INACTIVE(2);    private final int value;    ServiceTypeEnums(int value) {        this.value = value;    }    public int getValue() {        return value;    }    public static ServiceTypeEnums fromValue(int value) {        for (ServiceTypeEnums status : values()) {            if (status.value == value) {                return status;            }        }        throw new IllegalArgumentException("Invalid Service Type Enums value: " + value);    }    public static BookingStatusEnum fromName(String name) {        try {            return BookingStatusEnum.valueOf(name.toUpperCase());        } catch (IllegalArgumentException e) {            throw new IllegalArgumentException("Invalid Service Type Enums name: " + name, e);        }    }    public static ServiceTypeEnums fromString(String status) {        for (ServiceTypeEnums serviceTypeEnums : values()) {            if (serviceTypeEnums.name().equalsIgnoreCase(status)) {                return serviceTypeEnums;            }        }        throw new IllegalArgumentException("Invalid Service Type Enums string: " + status);    }}